import Nav from "./Nav";

const Layout = ({ props, mainTitle, footer }) => (
  <div>
    <Nav />
    <h1>{mainTitle}</h1>

    <hr />
    {props.children}

    <h1>{footer}</h1>
  </div>
);

export default Layout;
